import Head from "next/head"

const Headhtml = () => (
    <Head>
      <title> {this.props.title} </title>
      <meta
        name="viewport"
        content="initial-scale=1.0, width=device-width"
        key="viewport"
      />
    </Head>
  );

export default Head;
